import React from "react";
import { Switch, Route, Link, Router } from "react-router-dom";
import "./App.css";
import Signin from "./pages/auth/login";

function App() {
  return (
    <div className="App">
      <Link to="/" component={Signin} />
    </div>
  );
}

export default App;
